    return (
        <>
            <StrictMode>
                <Hearder /> 
                <div className="container">
                    <div className="row py-5">
                        <Outlet></Outlet>
                    </div>
                </div>
                <div className="bg-secondary-subtle"> <Footer /> </div>
            </StrictMode>
        </>
    );
}

export default Basic;
